import path from 'node:path';
import { PlaylistsFull } from '../../types/data';
import { getDb } from '../config/database';
import fs from 'node:fs'
import { getTimestamp } from '../config/helpers';
import { fileURLToPath } from 'node:url'
import { is } from '@electron-toolkit/utils';

interface RunResult {
  lastID: number;
  changes: number;
}

const __dirname = path.dirname(fileURLToPath(import.meta.url));

// Definir rutas dinámicamente con is.dev
const outputDir = is.dev
  ? path.join(__dirname, '../../src/renderer/public/music')
  : path.join(process.resourcesPath, 'app.asar.unpacked', 'out', 'renderer', 'music');

const imgDir = path.join(outputDir, 'img/playlists');

[outputDir, imgDir].forEach((dir) => {
  if (!fs.existsSync(dir)) {
    fs.mkdirSync(dir, { recursive: true });
  }
});

export function playlists(limit: number = 1000, offset: number = 0): Promise<PlaylistsFull[]> {
  const db = getDb();

  return new Promise((resolve, reject) => {
    const query = `
      SELECT 
        p.id AS playlist_id, 
        p.title, 
        p.color, 
        p.cover,
        p.date
      FROM playlists p
      LIMIT ? OFFSET ?
    `;
    
    // Primero obtenemos las playlists
    db.all(query, [limit, offset], (err: Error | null, rows: any[]) => {
      if (err) {
        reject(`Error fetching playlists: ${err.message}`);
        return;
      }

      // Mapeamos las playlists
      const playlists: PlaylistsFull[] = rows.map(row => {

        return {
          id: row.playlist_id,
          title: row.title,
          color: JSON.parse(row.color), // Asignamos el color correspondiente
          cover: row.cover,
          date: row.date,
          playlist_songs: [] // Inicializamos el arreglo vacío para las canciones
        };
      });

      // Ahora obtenemos las canciones para cada playlist
      const songQuery = `
        SELECT 
          ps.playlist_id,
          ps.song_id, 
          m.title AS song_title, 
          m.artist, 
          m.song, 
          m.image, 
          m.reproductions, 
          m.duration, 
          m.date AS song_date
        FROM playlist_songs ps
        JOIN songs m ON ps.song_id = m.id
        WHERE ps.playlist_id IN (${playlists.map(() => "?").join(", ")})
      `;

      // Extraemos los ids de las playlists para filtrar las canciones por playlist_id
      const playlistIds = playlists.map(p => p.id);

      // Hacemos la consulta de canciones
      db.all(songQuery, playlistIds, (err2: Error | null, songRows: any[]) => {
        if (err2) {
          reject(`Error fetching songs: ${err2.message}`);
          return;
        }

        // Asignamos las canciones a cada playlist
        playlists.forEach(playlist => {
          playlist.playlist_songs = songRows
            .filter(songRow => songRow.playlist_id === playlist.id)
            .map(songRow => ({
              id: songRow.song_id,
              playlist_id: songRow.playlist_id,  // Agregamos el playlist_id aquí
              song_id: songRow.song_id,  // Agregamos el song_id aquí
              date: songRow.song_date,
              song: {
                id: songRow.song_id,
                title: songRow.song_title,
                artist: songRow.artist,
                song: songRow.song,
                video: songRow.video,
                image: songRow.image,
                reproductions: songRow.reproductions,
                duration: songRow.duration,
                date: songRow.song_date
              },
              playlist: playlist  // Asociamos la playlist correspondiente
            }));
        });

        // Finalmente resolvemos con las playlists completas
        resolve(playlists);
      });
    });
  });
}

export function createPlaylist(
  title: string,
  color: { accent: string; dark: string },
  cover: string | undefined | null
): Promise<PlaylistsFull> {
  const db = getDb();

  return new Promise((resolve, reject) => {
    const sanitizeFilename = (name: string) => {
      return name
        .replace(/[\\/:*?"<>|]/g, '_') // Evitar caracteres no válidos
        .replace(/\s+/g, ' ') // Normalizar espacios
        .trim(); // Eliminar espacios innecesarios
    };

    const timestamp = Date.now();
    const sanitizedName = sanitizeFilename(title);

    let coverPath: string | null = null;

    const base64Regex = /^data:image\/(?:jpeg|png|gif|bmp|webp);base64,/;

    // Si hay una imagen de portada, procesarla
    if (cover && base64Regex.test(cover)) {
      try {
        const base64Data = cover.replace(/^data:image\/\w+;base64,/, '');
        const buffer = Buffer.from(base64Data, 'base64');

        const extensionMatch = cover.match(/^data:image\/(\w+);base64,/);
        const extension = extensionMatch ? extensionMatch[1] : 'png';

        const coverFilename = `${timestamp}.${extension}`;
        const coverDestination = path.join(imgDir, coverFilename);

        if (!fs.existsSync(imgDir)) {
          fs.mkdirSync(imgDir, { recursive: true });
        }

        fs.writeFileSync(coverDestination, buffer);
        coverPath = `music/img/playlists/${coverFilename}`;
      } catch (err) {
        reject(`Error saving cover image: ${(err as Error).message}`);
        return;
      }
    }else{
      const bg = "data:image/jpeg;base64,";
      const base64Data = bg.replace(/^data:image\/\w+;base64,/, '');
      const buffer = Buffer.from(base64Data, 'base64');

      const extensionMatch = bg.match(/^data:image\/(\w+);base64,/);
      const extension = extensionMatch ? extensionMatch[1] : 'png';

      const coverFilename = `${timestamp}.${extension}`;
      const coverDestination = path.join(imgDir, coverFilename);

      if (!fs.existsSync(imgDir)) {
        fs.mkdirSync(imgDir, { recursive: true });
      }

      fs.writeFileSync(coverDestination, buffer);
      coverPath = `music/img/playlists/${coverFilename}`;
    }

    // Serializar el color como JSON
    const serializedColor = JSON.stringify(color);

    // Insertar la playlist en la base de datos
    const insertQuery = `
      INSERT INTO playlists (title, color, cover, date)
      VALUES (?, ?, ?, ?) 
      RETURNING id
    `;
    const createdAt = getTimestamp()
    const params = [sanitizedName, serializedColor, coverPath, createdAt];

    db.run(insertQuery, params, function (this: RunResult, err) {
      if (err) {
        reject(`Error creating playlist: ${err.message}`);
        return;
      }

      const playlistId = this.lastID; // ID de la nueva playlist

      // Recuperar la playlist creada
      const selectQuery = `SELECT * FROM playlists WHERE id = ?`;
      db.get(selectQuery, [playlistId], (err2, row) => {
        if (err2) {
          reject(`Error fetching created playlist: ${err2.message}`);
          return;
        }

        const createdPlaylist: PlaylistsFull = {
          id: row.id,
          title: row.title,
          color: JSON.parse(row.color), // Deserializar el color
          cover: row.cover,
          date: row.date,
          playlist_songs: [], // Vacío al momento de crear
        };

        resolve(createdPlaylist);
      });
    });
  });
}

export function updatePlaylist(id: number | undefined, title: string, color: { accent: string; dark: string }, cover: string | undefined): Promise<PlaylistsFull> {
  const db = getDb();
  
  return new Promise((resolve, reject) => {
    const sanitizeFilename = (name: string) => {
      return name
        .replace(/[\\/:*?"<>|]/g, '_')  // Evitar caracteres no válidos en nombres de archivos
        .replace(/\s+/g, ' ')           // Normalizar espacios
        .trim();                        // Eliminar espacios innecesarios
    };

    if (!id) {
      reject('Missing playlist ID');
      return;
    }

    const timestamp = Date.now();
    const sanitizedTitle = sanitizeFilename(title);

    let coverPath: string | null = null;

    // Primero, obtenemos la canción actual para eliminar la imagen anterior si existe
    const selectQuery = `SELECT * FROM playlists WHERE id = ?`;
    db.get(selectQuery, [id], (err2, row) => {
      if (err2) {
        reject(`Error fetching song for update: ${err2.message}`);
        return;
      }

      if (!row) {
        reject('Record not found');
        return;
      }

      const base64Regex = /^data:image\/(?:jpeg|png|gif|bmp|webp);base64,/;

      // Eliminar la imagen anterior si existe
      if (row.cover && cover !== undefined && base64Regex.test(cover)) {
        const oldImagePath = path.join(outputDir, row.cover.replace(/^music\//, ''));
        if (fs.existsSync(oldImagePath)) {
          try {
            fs.unlinkSync(oldImagePath);  // Eliminar el archivo de la imagen anterior
          } catch (fileError) {
            reject(`Error deleting old image: ${(fileError as Error).message}`);
            return;
          }
        }
      }

      // Si hay una nueva imagen base64, procesarla
      if (cover && base64Regex.test(cover)) {
        try {
          // Convertimos la cadena base64 en un buffer para escribirla como archivo
          const base64Data = cover.replace(/^data:image\/\w+;base64,/, '');  // Eliminamos el prefijo 'data:image/...'
          const buffer = Buffer.from(base64Data, 'base64');

          // Determinar la extensión de la imagen
          const extensionMatch = cover.match(/^data:image\/(\w+);base64,/);
          const extension = extensionMatch ? extensionMatch[1] : 'png'; // Usamos 'png' como predeterminado si no se encuentra

          // Generamos el nombre y la ruta de la imagen
          const imageFilename = `${timestamp}.${extension}`;
          const imageDestination = path.join(imgDir, imageFilename);

          // Crear directorio si no existe
          if (!fs.existsSync(imgDir)) {
            fs.mkdirSync(imgDir, { recursive: true });
          }

          // Guardar la imagen como archivo
          fs.writeFileSync(imageDestination, buffer);

          coverPath = `music/img/playlists/${imageFilename}`;
        } catch (err) {
          reject(`Error saving image: ${(err as Error).message}`);
          return;
        }
      }

      // Consulta SQL para actualizar la canción
      const updateQuery = `
        UPDATE playlists 
        SET title = ?, color = ? ${coverPath ? ', cover = ? ' : ''} 
        WHERE id = ?;
      `;

      // Serializar el color como JSON
      const serializedColor = JSON.stringify(color);

      const params = [sanitizedTitle, serializedColor, ...(coverPath ? [coverPath] : []), id];

      db.run(updateQuery, params, function (err) {
        if (err) {
          reject(`Error updating song: ${err.message}`);
          return;
        }

        // Obtener la canción actualizada después de la modificación
        const updatedSelectQuery = `SELECT * FROM playlists WHERE id = ?`;
        db.get(updatedSelectQuery, [id], (err3, updatedRow) => {
          if (err3) {
            reject(`Error fetching updated song: ${err3.message}`);
            return;
          }

          const songQuery = `
            SELECT 
              ps.playlist_id,
              ps.song_id, 
              m.title AS song_title, 
              m.artist, 
              m.song, 
              m.image, 
              m.reproductions, 
              m.duration, 
              m.date AS song_date
            FROM playlist_songs ps
            JOIN songs m ON ps.song_id = m.id
            WHERE ps.playlist_id = ?;
          `;

          db.all(songQuery, [id], (err4, songRows) => {
            if (err4) {
              reject(`Error fetching songs for playlist: ${err4.message}`);
              return;
            }

            const playlistSongs = songRows.map(songRow => ({
              id: songRow.song_id,
              playlist_id: songRow.playlist_id,
              song_id: songRow.song_id,
              date: songRow.song_date,
              song: {
                id: songRow.song_id,
                title: songRow.song_title,
                artist: songRow.artist,
                song: songRow.song,
                image: songRow.image,
                reproductions: songRow.reproductions,
                duration: songRow.duration,
                date: songRow.song_date,
              },
              playlist: updatedRow
            }));

            const updatedPlaylist: PlaylistsFull = {
              id: id,
              title: updatedRow.title,
              color: JSON.parse(updatedRow.color),
              cover: updatedRow.cover,
              date: updatedRow.date,
              playlist_songs: playlistSongs,
            };

            resolve(updatedPlaylist);
          });
        });
      });
    });
  });
}

export function deletePlaylist(id: number): Promise<boolean> {
  const db = getDb();
  return new Promise((resolve, reject) => {
    const selectQuery = `SELECT * FROM playlists WHERE id = ?`;
    db.get(selectQuery, [id], (err, row) => {
      if (err) {
        reject(`Error fetching playlist for deletion: ${err.message}`);
        return;
      }

      if (!row) {
        reject('Record not found');
        return;
      }

      // Eliminar la imagen de la portada si existe
      if (row.cover) {
        const imagePath = path.join(outputDir, row.cover.replace(/^music\//, ''));
        if (fs.existsSync(imagePath)) {
          try {
            fs.unlinkSync(imagePath);  // Eliminar el archivo de la imagen
          } catch (fileError) {
            reject(`Error deleting image: ${(fileError as Error).message}`);
            return;
          }
        }else{
          reject('Image not found');
          return;
        }
      }

      const deleteQuery = `DELETE FROM playlists WHERE id = ?`;
      db.run(deleteQuery, [id], function (this: RunResult, err2) {
        if (err2) {
          reject(`Error deleting playlist: ${err2.message}`);
          return;
        }

        if (this.changes === 0) {
          reject('No record found');
          return;
        }

        resolve(true);
      });
    });
  });
}
